import React from 'react';
//import Arrow from './index.js';

export const moEscolhaDoc = (modo) => (
    <div>
      <h2>moEscolhaDoc</h2>
       <p>
        Exemplo do componente.
        modo={modo}
      </p>
    </div>
);

export default moEscolhaDoc;
